// default row & column setup
// 
// 
var layerElements = [
    [1, [1,2] ], //column -> [width, [element1_Height,element2_Height,...] ]
    [1, [2,1] ],
    [1, [1,2] ]
];

var layerAnimationDirection = 0;

function createMaskedLayers () {

    //get selected layers
    var curItem = app.project.activeItem;
    var selectedLayers = curItem.selectedLayers;

    var compWidth = curItem.width;
    var compHeight = curItem.height;

    
    
    // -----------------------------
    // calculate column width
    // -----------------------------
    
    var gridColumns = 0;

    
    var i=0;
    while( i < layerElements.length){
        gridColumns = gridColumns + layerElements[i][0];
        i++;
    }

    if(gridColumns < 1) gridColumns = 1;

    var columnWidth = compWidth/gridColumns;

    
    

    // -----------------------------
    // calculate row height
    // & create layers
    // -----------------------------

    var c=0; //counter for loop
    var lc = 0; //index for the layer elements
    var layers = []; //variable to store generated layers

    while( c < layerElements.length){
        
        var g = layerElements[c][1];
        var sg = 0;
        var ic = 0;
        while( ic < g.length){
            
            sg = sg + g[ic];
            
            ic++;
        }
        var rowHeight = compHeight/sg;

        //create elements for column
        var cl = 0;
        while(cl < layerElements[c][1].length){

            // calculate element width and height
            var lwidth = columnWidth * layerElements[c][0];
            var lheight = rowHeight * layerElements[c][1][cl];

            // calculate element offset
            var xoffset = columnWidth * c;

            if(cl > 0){
                var yoffset = rowHeight * layerElements[c][1][cl-1];
            }else{
                var yoffset = 0;
            }

            // create layers
            if(lc > 0){
                var layerobj = selectedLayers[0].duplicate();
            }else{
                var layerobj = selectedLayers[0];
            }

            var layer = {"layer" : layerobj, "xoffset" : xoffset, "yoffset" : yoffset, "width" : lwidth, "height" : lheight};
            layers.push(layer);
            

            lc++;
            cl++;
        }

        c++;
    }

    i = 0;
    while( i < layers.length ) {

        //set animation direction
        if(layerAnimationDirection != 0) { var dir =  layerAnimationDirection[i]; }
        else if(layers[i].yoffset > 0) { var dir = "-y"; }
        else { var dir = "y"; }

        
        createMask(layers[i].layer, layers[i].xoffset, layers[i].yoffset, layers[i].width, layers[i].height);
        animateMaskedLayer(layers[i].layer, layers[i].height, layers[i].width, compHeight, compWidth, layers[i].xoffset, layers[i].yoffset, dir);
        i++;
    }

    //move first layer to top of stack
    selectedLayers[0].moveBefore(layers[1].layer);

}

function createMask (layer, x,y,w,h) {
    newMask = layer.Masks.addProperty("Mask");
    newMask.inverted = false;
    myMaskShape = newMask.property("maskShape");
    myShape = myMaskShape.value;
    myShape.vertices = [[x,y],[x,y+h],[x+w,y+h],[x+w,y]];
    myShape.closed = true;
    myMaskShape.setValue(myShape);
}


function createGuideline() {
  if(guideHorizontal){
      app.project.activeItem.addGuide(guidePos, 1);
  }else{
      app.project.activeItem.addGuide(1, guidePos);
  }
}


function animateMaskedLayer(layer, h, w, compH, compW, xoffset, yoffset, dir) {

    if(dir == "y"){
        var x1 = compW/2;
        var y1 = compH/2 - h;
    }else if(dir == "-y"){
        var x1 = compW/2;
        var y1 = 1.5*compH - yoffset;
    }else if(dir == "x"){
        var x1 = 0.5*compW - w;
        var y1 = compH/2;
    }else if(dir == "-x"){
        var x1 = 1.5*compW - xoffset;
        var y1 = compH/2;
    }


    //target position
    var x2 = compW/2;
    var y2 = compH/2;

    //calculate time offset for animation end
    var offset = beatsOffset*beatDuration;
    var animEnd = layer.inPoint + offset;

    layer.position.setValueAtTime(layer.inPoint, [x1,y1]);
    layer.position.setValueAtTime(animEnd, [x2,y2]);

}

function offsetLayer() {

    var curItem = app.project.activeItem;
    var layers = curItem.selectedLayers;

    var i = 0;
    var start = layers[0].startTime;

    while( i < layers.length ) {

        start = i*(beatsOffset*beatDuration);
        layers[i].startTime = start;

        i++;
    }
}